import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

const data = {
  buttonText: 'Button1',
  customText: ''
}

ReactDOM.render(
  <App buttonInfo={data}/>,
  document.getElementById('my-jsx-element')
);

serviceWorker.unregister();
